import Vue from 'vue'
import VueRouter from 'vue-router'
import Body from '../views/Body.vue'
import Grid from '../views/Grid.vue'
import Login from '../views/Login.vue'
import SS from '../views/SS.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    component: HomePage
  },
  {
    path: "/user/:id",
    component: User1,
    props: true,
    children: [
      {
        path: "",
        component: TaskTab
      },
      {
        path: "project",
        component: ProjectTab
      },
      {
        path: "home",
        component: Body
      },
      {
        path: "about",
        component: About
      },
      {
        path: "grid",
        component: Grid
      },
      {
        path: "login",
        component: Login
      },
      {
        path: "ss",
        component: SS
      },
    ]
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
